import { Link } from 'react-router-dom';

const Sidebar = () => {


    return (
        <div className="sidebar">
            <button className="sidebar-btn">
                <Link to={"/"}>Home</Link>
            </button>
            <button className="sidebar-btn">
                <Link to={"/trade"}>Trade</Link>
            </button>
            <button className="sidebar-btn">
                <Link to={"/blockchain"}>Blockchain</Link>
            </button>
        </div>
    )
};

export default Sidebar
